INSERT INTO `article_data` (`id_article_data`, `article_id`, `language_id`, `article_title`, `content`) VALUES
	(1, 1, 1, 'our practices', '<div style="background-image:url(\'http://lawm.sa/assets/img/bg1.jpg\');background-size: 100%;background-repeat: no-repeat;height:600px;" >\n\n<center class="welcometext" >\n\n<h2>WELCOME TO LAWM<hr/>  A Leading Law Firm for Business, Family and Criminal Matters</h2>\n\n<p>Lawm specializes in strong family business practice with an emphasis on legal consultations, contract writing, company establishment and appeals in Saudi Arabia.\n \nOur professional attorneys combine solid legal expertise and diverse legal backgrounds allowing for the structuring of unique legal solutions for your complex business needs.</p>\n\n</center>\n\n</div>\n'),
	(4, 8, 2, 'ممارساتنا', '\n\n<div style="background-image:url(\'http://lawm.sa/assets/img/bg1.jpg\');background-size: 100%;background-repeat: no-repeat;height:600px;" >\n\n<center class="welcometext" >\n\n<h2>اجي للمحاماة هي شركة رائدة مت<hr/>  اجي للمحاماة هي شركة رائدة متخصصة في ممارسة الشركات العائلية مع التركيز على استدامة الأعمال والتخطيط للخلافة، ودعم وهيكلة الشركات والحكم.</h2>\n\n\n<p>ناجي للمحاماة هي شركة رائدة متخصصة في ممارسة الشركات العائلية مع التركيز على استدامة الأعمال والتخطيط للخلافة، ودعم وهيكلة الشركات والحكم.\n\n\nناجي للمحاماة هي شركة رائدة متخصصة في ممارسة الشركات العائلية مع التركيز على استدامة الأعمال والتخطيط للخلافة، ودعم وهيكلة الشركات والحكم.</p>\n\n</center>\n\n</div>\n\n'),
	(5, 9, 1, 'Contact us', '<p>Riyadh ZIP code 11573 , PO Box 52977 King Abdulaziz district of Salah al - Din road against the field Mosque (Qasr al - Hariri)&nbsp;<br />\nCalifornia, US&nbsp;<br />\nPhone: 01/4550844, 01/4944018&nbsp;<br />\nFax: 01/4503187&nbsp;<br />\nEmail: info@lawm.sa</p>\n'),
	(6, 9, 2, 'اتصل بنا', '<p>الرياض الرمز البريدي 11573، ص.ب 52977 حي الملك عبد العزيز صلاح - طريق الدين ضد هذا المجال المسجد (قصر - الحريري)<br />\nكاليفورنيا، الولايات المتحدة<br />\nالهاتف: 01/4550844، 01/4944018<br />\nفاكس: 01/4503187<br />\nالبريد الإلكتروني: info@almurafaat.com</p>\n'),
